import React from 'react';
import '../css/titulo.css';
import logo from '../img/logo.jpg';

const Titulo = () => {
  return (
    <>
      <div>
           <h2 className="promo-texto">Compra ahora y pague después con Sistecrédito y Addi</h2>
      </div>
      <div className="titulo-contenedor">
        <img src={logo} alt="Logo de Diseños Stely" className="logo" />
        <h1 className="titulo-principal">Diseños Stely</h1>

     
        <p className="subtitulo">Empresa nortesantandereana con calidad y elegancia</p>
      </div>
    </>
  );
};

export default Titulo;
